import React, {Component}  from 'react';
import Ul_ly2 from "./ul_lay2.js";
import './head.css'

class LiName extends Component {
    render() {
        const li_name = [
            "РЕСИВЕРЫ",
            "VOD",
            "iT",
            "SHOW-roomы",
            "заказы",
            "EPG",
            "Каналы",
            "Баги (:"
        ]

    var li_map =  li_name.map((value)=>{
        console.log(value)
       return <li className="li"><a>{value}</a><Ul_ly2 /></li>
    })
       return li_map
    }
  }

class Head_ul extends Component {
    render() {
        return (
            // <LiName />
            <div>ddd</div>
        )
    }
  }

  export default Head_ul;
